/*
    this runs when the device is ready for user interaction:
*/
    onDeviceReady: function() {
        // check to see if Bluetooth is turned on.
        // this function is called only
        //if isEnabled(), below, returns success:
        var listPorts = function () {
            // list the available BT ports:
            bluetoothSerial.list(
                function(results) {
                    app.listarImpressora(results);
                },
                function(error) {
                    app.display(JSON.stringify(error));
                }
            );
        }

        // if isEnabled returns failure, this function is called:
        var notEnabled = function() {
            app.display("Bluetooth is not enabled.")
        }

         // check if Bluetooth is on:
        bluetoothSerial.isEnabled(
            listPorts,
            notEnabled
        );
    },

    testeSucess: function () {
      console.log('testeSucess testeSucess')
      app.openPort()
    },


/*
    Connects if not connected, and disconnects if connected:
*/
    manageConnection: function (MAC) {
        console.log('MAC 1111', MAC)

        // connect() will get called only if isConnected() (below)
        // returns failure. In other words, if not connected, then connect:
      var connect = function (MAC) {
        console.log('MAC MAC MAC', MAC)
            // if not connected, do this:
            // clear the screen and display an attempt to connect
            app.clear();
            app.display("Attempting to connect. " +
                "Make sure the serial port is open on the target device.");
            // attempt to connect:
            bluetoothSerial.connect(
                MAC,  // device to connect to
                app.testeSucess,    // start listening if you succeed
                app.showError    // show the error if you fail
            );
        };

        // disconnect() will get called only if isConnected() (below)
        // returns success  In other words, if  connected, then disconnect:
        var disconnect = function () {
            app.display("attempting to disconnect");
            // if connected, do this:
            bluetoothSerial.disconnect(
                app.closePort,     // stop listening to the port
                app.showError      // show the error if you fail
            );
        };

        // here's the real action of the manageConnection function:
      bluetoothSerial.isConnected(disconnect, connect(MAC));
    },
